import { useState } from "react";

import { appletView } from './Applet';

function Navbar() {

    const [ appletConst, setAppletConst ] = useState("");

    const setView = (view) => {
        try {
            console.log(view);
            setAppletConst(view);
        } catch (err) {
            console.error('Error setting applet view from navbar:', err);
        }
    }

    appletView.value = appletConst;
    console.log("Applet View = " + appletView.value);

    return(
        
        /* NAVBAR */
        <nav id="navbar" className="navbar sticky-top navbar-expand-lg navbar-dark bg-dark">
            <div className="container-fluid">

                <div className="collapse navbar-collapse" id="navbarNav">
                
                    {/* <ul className="navbar-nav">
                        <li className="nav-item" onClick={setView("home")}>
                            <a className="nav-link" href="#" >Home</a>
                        </li>
                        <li className="nav-item" onClick={setView("clients")}>
                            <a className="nav-link" href="#" >Clients</a>
                        </li>
                        <li className="nav-item" onClick={setView("new-client")}>
                            <a className="nav-link" href="#" >[Add New Client]</a>
                        </li>
                    </ul> */}

                    <ul className="navbar-nav">
                        <li className="nav-item" onClick={setView("home")}>
                            <a className="nav-link active">Home</a>
                        </li>
                        <li className="nav-item" onClick={setView("clients")}>
                            <a className="nav-link">Clients</a>
                        </li>
                        <li className="nav-item" onClick={setView("new-client")}>
                            <a className="nav-link">[Add New Client]</a>
                        </li>
                    </ul>

                </div>
                
            </div>
        </nav>
    );

};

export default Navbar;
